result:
.auth-transfer{
  width: 100%;
  height: 100%;

  .el-row{
    height: 100%;
  }

  .auth-item,
  .auth-all-item{
    background-color: #F6F8FE;
    padding: 15px;
  }

  .auth-tree-title {
    text-indent: 27px;
    position: relative;
    font-size: 16px;
    font-weight: 500;
  }

  .auth-tree-title::before {
    content: '';
    position: absolute;
    left: 0;
    width: 7px;
    height: 16px;
    background: rgba(63, 106, 255, 1);
    border-radius: 4px;
  }

  .auth-tree{
    height: calc(100% - 30px);
    margin-top: 10px;
    overflow-y: auto;

    .el-tree {
      background-color: #F6F8FE;
    }

    .el-checkbox__inner{
      border-radius: 50%;
    }

    .is-indeterminate .el-checkbox__inner,
    .is-checked .el-checkbox__inner{
      background-color: #3F6AFF;
      border-color: #3F6AFF;
    }
  }

  .auth-bg{
    background-color: #ffffff;
    height: 100%;
    text-align: center;
    position: relative;

    .auth-set-btn{
      position: relative;
      top: 50%;
      transform: translateY(-50%);

      div{
        width: 100%;
        max-width: 100px;
        height: 60px;
        padding-top: 22px;
        background-size: 100% 100%;
        background-repeat: no-repeat;
      }

      & div:nth-child(1){
        background-image: url('../../../assets/images/auth_right.png')
      }

      & div:nth-child(2){
        margin-top: 8px;
        background-image: url('../../../assets/images/auth_left.png')
      }

      .auth-disable{
        color: #C9CBD7;
        cursor: no-drop;
      }

      .auth-available{
        color: #3F6AFF;
        cursor: pointer;
      }
    }
  }
}
